import { useState } from "react";
import { Route, Routes, Link } from "react-router-dom";
import "./App.css";
import Footer from "./Components/Footer";

import Navbar from "./Components/Navbar";
import NftList from "./Components/NftList";

function App() {
  const [light, SetLight] = useState(false);
  console.log(light);
  return (
    // <div>
    //   <nav>
    //     <Link to="me"> hoijn</Link>
    //   </nav>
    //   <Routes>
    //     <Route path="me" element={<MyNFT />} />
    //   </Routes>
    // </div>
    <div className="App">
      <Navbar SetLight={SetLight} light={light} />
      <div className="image">
        <img src="./img/lamp.png" className="lamp" />
        <img src="./img/light.png" className={light ? "light_on" : "light"} />
      </div>
      <div className="text">
        <h2>Super NFT Market</h2>
        <div className="text_test">
          <p>
            Transactions through our market increase users' assets than before.
          </p>
          <span>Increase your assets through various NFT transactions</span>
        </div>
      </div>
      <Routes>
        <Route path="MyNFT" element={<NftList />} />
      </Routes>

      <Footer />
    </div>
  );
}

export default App;
